import React from 'react';
import { Box, Typography } from '@mui/material';
import { useParams } from 'react-router-dom';

const ClientDetails = () => {
  const { id } = useParams();

  return (
    <Box sx={{ p: 3 }}>
      <Typography variant="h5" component="h1">
        Client Details
      </Typography>
      <Typography>Client ID: {id}</Typography>
    </Box>
  );
};

export default ClientDetails;
